import CampaingModel from '../../../models/campaing'
import { CampaingName, HeaderContainer } from './styles'

interface Props {
  campaing: CampaingModel
}

const HeaderCampaing = ({ campaing }: Props) => {
  return(
    <HeaderContainer>
      <CampaingName>
        {campaing.name}
      </CampaingName>
    </HeaderContainer>
  )
}

export default HeaderCampaing
